(3051, 0, TRUE, 'org.modelcatalogue.core.CatalogueElement', 'is synonym for', NULL, NULL, 'synonym', 'isSameClass()', FALSE, 'org.modelcatalogue.core.CatalogueElement', 'is synonym for', 'A Catalogue Element can be a synonym of multiple Catalogue Elements of the same type having similar meaning.', FALSE, FALSE),
