(3055, 0, FALSE, 'org.modelcatalogue.core.security.User', 'filtered by', 'A User can filter by multiple classifications. To use exclusion filter instead of inclusion, set metadata $exclude to any non-null value.', NULL, 'classificationFilter', NULL, FALSE, 'org.modelcatalogue.core.DataModel', 'used as filter by', 'A Classification can be used as filter by multiple users. This is done using the classification filter in bottom left corner.', TRUE, FALSE),
