(3058, 0, FALSE, 'org.modelcatalogue.core.DataElement', 'is tagged by', 'Data Elements can be tagged by multiple Tags', NULL, 'tag', NULL, FALSE, 'org.modelcatalogue.core.Tag', 'tags', 'A Tag may tag multiple Data Elements', FALSE, FALSE);              
